function TicketInfoPanel({seat}) 
{
    return (
      <>
        <p>Seat: {seat.number}</p>
        {seat.isOccupied ? (
            <p>Traveler: {"" + seat.traveler.name + " " + seat.traveler.surname}</p>

        ):(
            <p>Traveler: Empty</p>
        )}
      </>
    );
}

  
export default TicketInfoPanel;
